import Foundation

class  CategoriesConfigurator: CategoriesConfiguratorProtocol {
    
    func configure(with viewController: CategoriesViewController) {
        let presenter =  CategoriesPresenter(view: viewController)
        let router =  CategoriesRouter(viewController: viewController)
        viewController.presenter = presenter
        presenter.router = router
    }
}
